import React, { useState } from "react";

const PC = () => {
  return (
    <div id="pc">
      <div id="loading-screen">
      <div></div>
        <img id="winblows-logo" src="/winblows logo.png"></img>
        <div>
          <input style={{
            width: '160px',
            backgroundColor: "lightblue"
          }} placeholder="username" type="text"></input>
          <br/>
          <input style={{
            backgroundColor: "lightblue",
            fontWeight: 'bold',
            width: '160px'
          }} value="Login" type="button"></input>
        </div>
        <div></div>
        <div></div>
      </div>
    </div>
  )
}

export default PC;
